import React, { useState } from 'react'

const pics = {

    bird : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSECYpGH4X5r3tgihULoEYj8pLPg451dAiztw&usqp=CAU',
    alligator : 'data:image/png;base64,',
    cat : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQziy4OXkRJ0q5xeyVGETCxBnIRPIBodgQyCQ&usqp=CAU',
    cow : 'data:image/png;base64,',
    dog : 'data:image/png;base64,',
    horse : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ0oWeuY4XNbol3CpjpaXnXA1FtonBLixQAkw&usqp=CAU',
    heart : 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTomyH_19arwQphecl48d5Pgr5jKuxQMJPxkg&usqp=CAU',
}

function ShowAnimal({type}) {
    const [heartSize, setHeartSize] = useState(0)

    return (
        <>
            <div>{type}</div>
            <div onClick={() => setHeartSize(heartSize + 2) }>
                <img src={pics[type]} style={{maxWidth: '10rem', maxHeight: '10rem'}} />
                <img src={pics['heart']}
                    style={{
                        width: `${heartSize}rem`,
                        height: `${heartSize}rem`,
                        maxWidth: `8rem`,
                        maxHeight: `8rem`,
                    }} />
            </div>
        </>
    )
}

export default ShowAnimal